import { Route, Router, Routes } from 'react-router-dom';
import './App.css';
import Login from "./components/Login"

function App() {
  return (
    <div>
        <Router>
          <Routes>
              <Route path='/' element={<Login/>}/>
          </Routes>
        </Router>
      </div>
  )
}

export default App;
